import * as React from 'react';

import { Field } from '@progress/kendo-react-form';

import {FormInput, FormAutoComplete, FormRadioGroup,FormTextArea} from './form-components';

import {
    nameValidator, requiredValidator, regNoValidator
} from './validators'

import {countries, genders } from './data'


export const EducationalDetails = (
    <div>
        <div>
            
            <h3>MET<hr></hr></h3>
        
        </div>
    <Field
      key={'metrollNo'}
      id={'metrollNo'}
      name={'metrollNo'}
      label={'MET Roll No.'}
      component={FormInput}
      validator={nameValidator}
        />
          <Field
      key={'metrank'}
      id={'metrank'}
      name={'metrank'}
      label={'MET Rank'}
      component={FormInput}
      validator={nameValidator}
        />         
    
    <Field
      key={'metscore'}
      id={'metscore'}
      name={'metscore'}
      label={'MET Score'}
      layout={'horizontal'}
      component={FormInput}
      validator={nameValidator}
        />
        
        <div>
            
            <h3>EDUCATIONAL INFO<hr></hr></h3>
        
        </div>
        <div>
            
            <h3>10th DETAILS<hr></hr></h3>
        
        </div>
    <Field
      key={'tenthboardUniv'}
      id={'tenthboardUniv'}
      name={'tenthboardUniv'}
      label={'Board'}
      component={FormInput}
      validator={nameValidator}
        />
          <Field
      key={'tenthPassingYear'}
      id={'tenthPassingYear'}
      name={'tenthPassingYear'}
      label={'Passing Year'}
      component={FormInput}
      validator={nameValidator}
        />         
    
    <Field
      key={'tenthPerCGPA'}
      id={'tenthPerCGPA'}
      name={'tenthPerCGPA'}
      label={'Percentage/CGPA'}      
      component={FormInput}
      validator={nameValidator}
        />
        
        


    
  </div>
);
